import { Divider, Toolbar, IconButton, Typography } from "@material-ui/core";
import MenuIcon from "@material-ui/core";
import NotificationsIcon from "@material-ui/core";

const Header = () => {
    return (
        <>
            <Toolbar>
                <IconButton>
                    <MenuIcon />  
                </IconButton>

                <Typography variant="h6">Blogging Website</Typography>

                <IconButton>
                    <NotificationsIcon />
                </IconButton>

                
            </Toolbar>

            <Divider />



        </>    
    );
}

export default Header;
